import React from 'react';
import ReactDOM from 'react-dom';

const fname = "Saurav";
const lname = "Prasai";

ReactDOM.render(
  <>
    <h1>My name is {`My name is ${fname} ${lname}`}</h1>
    <p> My lucky number is {Math.random()}</p>
  </>
  ,document.getElementById('root')
)
